/*Table structure for table `sys_ad` */

DROP TABLE IF EXISTS `sys_ad`;

CREATE TABLE `sys_ad` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `title` varchar(100) NOT NULL COMMENT '广告标题',
  `ad_sort_id` smallint(5) unsigned NOT NULL DEFAULT 0 COMMENT '广告位ID',
  `cover` varchar(255) DEFAULT NULL COMMENT '广告图片',
  `type` tinyint(1) unsigned NOT NULL DEFAULT 0 COMMENT '广告格式：1图片 2文字 3视频 4推荐',
  `description` varchar(150) DEFAULT NULL COMMENT '广告描述',
  `content` text DEFAULT NULL COMMENT '广告内容',
  `url` text DEFAULT NULL COMMENT '广告链接',
  `width` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '广告宽度',
  `height` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '广告高度',
  `start_time` datetime DEFAULT NULL COMMENT '开始时间',
  `end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `view_num` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '广告点击次数',
  `status` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '状态：1在用 2停用',
  `sort` smallint(5) unsigned NOT NULL DEFAULT 125 COMMENT '排序',
  `create_user` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '添加人',
  `create_time` datetime NOT NULL COMMENT '添加时间',
  `update_user` int(10) unsigned DEFAULT 0 COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `mark` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '有效标识(1正常 0删除)',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `title` (`title`) USING BTREE,
  KEY `ad_sort_id` (`ad_sort_id`) USING BTREE
