/*Table structure for table `sys_ad_sort` */

DROP TABLE IF EXISTS `sys_ad_sort`;

CREATE TABLE `sys_ad_sort` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `name` varchar(50) NOT NULL COMMENT '广告位名称',
  `description` varchar(255) NOT NULL COMMENT '广告位描述',
  `item_id` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '站点ID',
  `cate_id` smallint(5) unsigned NOT NULL DEFAULT 0 COMMENT '栏目ID',
  `loc_id` smallint(5) unsigned NOT NULL DEFAULT 0 COMMENT '广告页面位置',
  `platform` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '站点类型：1PC网站 2WAP手机站 3微信小程序 4APP移动端',
  `sort` smallint(5) unsigned NOT NULL DEFAULT 125 COMMENT '广告位排序',
  `create_user` int(10) unsigned DEFAULT 0 COMMENT '添加人',
  `create_time` datetime DEFAULT NULL COMMENT '添加时间',
  `update_user` int(10) unsigned DEFAULT 0 COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `mark` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '有效标识(1正常 0删除)',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='广告位管理表';

/*Data for the table `sys_ad_sort` */

