/*Table structure for table `sys_config_data` */

DROP TABLE IF EXISTS `sys_config_data`;

CREATE TABLE `sys_config_data` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `title` varchar(50) NOT NULL COMMENT '配置标题',
  `code` varchar(100) NOT NULL COMMENT '配置编码',
  `value` text DEFAULT NULL COMMENT '配置值',
  `options` varchar(255) DEFAULT NULL COMMENT '配置项',
  `config_id` smallint(3) unsigned NOT NULL DEFAULT 0 COMMENT '配置分组ID',
  `type` varchar(16) NOT NULL COMMENT '配置类型',
  `status` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '状态：1正常 2停用',
  `sort` smallint(3) unsigned NOT NULL DEFAULT 0 COMMENT '排序',
  `note` varchar(500) DEFAULT NULL COMMENT '配置说明',
  `create_user` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '添加人',
  `create_time` datetime DEFAULT NULL COMMENT '添加时间',
  `update_user` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `mark` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '有效标识：1正常 0删除',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `index_title` (`title`) USING BTREE,
  KEY `index_code` (`code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='配置表';

