/*Table structure for table `sys_login_log` */

DROP TABLE IF EXISTS `sys_login_log`;

CREATE TABLE `sys_login_log` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '唯一性标识',
  `title` varchar(150) NOT NULL COMMENT '日志标题',
  `username` varchar(30) NOT NULL DEFAULT '' COMMENT '登录账号',
  `login_ip` varchar(50) DEFAULT '' COMMENT '登录IP地址',
  `login_location` varchar(30) DEFAULT NULL COMMENT '登录地区',
  `browser` varchar(50) DEFAULT '' COMMENT '浏览器类型',
  `os` varchar(50) DEFAULT '' COMMENT '操作系统',
  `status` tinyint(1) unsigned DEFAULT 1 COMMENT '登录状态：0成功 1失败',
  `type` tinyint(1) unsigned DEFAULT 0 COMMENT '操作类型：1登录系统 2注销系统 3刷新Token',
  `note` varchar(255) CHARACTER SET utf8 DEFAULT '' COMMENT '登录备注',
  `create_user` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '添加人',
  `create_time` datetime DEFAULT NULL COMMENT '登录时间',
  `update_user` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `mark` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '有效标记',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=150 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='登录日志表';

