/*Table structure for table `sys_menu` */

DROP TABLE IF EXISTS `sys_menu`;

CREATE TABLE `sys_menu` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `pid` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '父级ID',
  `title` varchar(30) NOT NULL COMMENT '菜单标题',
  `icon` varchar(50) DEFAULT NULL COMMENT '图标',
  `path` varchar(150) DEFAULT NULL COMMENT '菜单路径',
  `component` varchar(150) DEFAULT NULL COMMENT '菜单组件',
  `target` varchar(30) DEFAULT NULL COMMENT '目标',
  `permission` varchar(150) DEFAULT NULL COMMENT '权限标识',
  `type` tinyint(1) unsigned NOT NULL DEFAULT 0 COMMENT '类型：1目录 2菜单 3节点',
  `status` tinyint(1) unsigned DEFAULT 1 COMMENT '是否显示：1显示 2不显示',
  `note` varchar(255) DEFAULT NULL COMMENT '备注',
  `sort` smallint(5) unsigned DEFAULT 125 COMMENT '显示顺序',
  `create_user` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '添加人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` int(11) unsigned DEFAULT 0 COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `mark` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '有效标识',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `index_pid` (`pid`) USING BTREE,
  KEY `index_name` (`title`) USING BTREE
