/*Table structure for table `sys_oper_log` */

DROP TABLE IF EXISTS `sys_oper_log`;

CREATE TABLE `sys_oper_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `title` varchar(150) CHARACTER SET utf8mb4 NOT NULL COMMENT '日志标题',
  `log_type` int(2) unsigned NOT NULL DEFAULT 0 COMMENT '操作类型（0其它 1新增 2修改 3删除）',
  `oper_method` varchar(100) DEFAULT '' COMMENT '操作方法',
  `request_method` varchar(10) DEFAULT '' COMMENT '请求方式',
  `oper_type` int(1) unsigned NOT NULL DEFAULT 0 COMMENT '操作类型：0其他 1后台用户 2WAP用户',
  `oper_name` varchar(50) NOT NULL DEFAULT '' COMMENT '操作人员',
  `oper_url` varchar(255) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '请求URL',
  `oper_ip` varchar(50) DEFAULT '' COMMENT '主机地址',
  `oper_location` varchar(255) DEFAULT '' COMMENT '操作地点',
  `oper_param` varchar(2000) DEFAULT '' COMMENT '请求参数',
  `json_result` varchar(2000) DEFAULT '' COMMENT '返回参数',
  `status` int(1) DEFAULT 0 COMMENT '操作状态（0正常 1异常）',
  `note` varchar(2000) DEFAULT '' COMMENT '备注',
  `create_user` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '添加人',
  `create_time` datetime DEFAULT NULL COMMENT '操作时间',
  `update_user` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `mark` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '有效标识',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=120 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='操作日志记录';

