/*Table structure for table `sys_report` */

DROP TABLE IF EXISTS `sys_report`;

CREATE TABLE `sys_report` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `title` varchar(250) DEFAULT NULL COMMENT '标题',
  `sourceurl` text DEFAULT NULL COMMENT '原文链接',
  `source` varchar(50) DEFAULT NULL COMMENT '来源',
  `keyword` varchar(100) DEFAULT NULL COMMENT '关键词',
  `author` varchar(20) DEFAULT NULL COMMENT '作者',
  `username` varchar(20) DEFAULT NULL COMMENT '用户名',
  `medtype` int(11) unsigned NOT NULL DEFAULT 1 COMMENT '媒体类型: 1网站 2论坛 3博客 4微博 5纸媒 6微信 7App',
  `yuqingtype` int(11) unsigned NOT NULL DEFAULT 1 COMMENT '舆情类型',
  `infotype` int(11) unsigned NOT NULL DEFAULT 1 COMMENT '信息类型: 1原文 2动态 3卖报',
  `grade` int(11) unsigned NOT NULL DEFAULT 1 COMMENT '等级舆情: 1Ⅰ级信息 2Ⅱ级信息 3Ⅲ级信息',
  `sendtime` datetime DEFAULT NULL COMMENT '报送时间',
  `filetime` datetime DEFAULT NULL COMMENT '刊发时间',
  `workunit` varchar(250) DEFAULT NULL COMMENT '报送单位',
  `uid` int(11) DEFAULT NULL COMMENT '报送人',
  `special_id` int(11) DEFAULT NULL COMMENT '专题选择',
  `domaintype` int(11) unsigned NOT NULL DEFAULT 1 COMMENT '领域类型: 1时政 2经济 3文化理论 4其他',
  `content` text DEFAULT NULL COMMENT '正文',
  `attachment` varchar(250) DEFAULT NULL COMMENT '附件',
  `sendtoa` int(11) unsigned NOT NULL DEFAULT 1 COMMENT '发送对象: 1区政府 2区宣传部 3区网信办 4中宣部 5中央网信办',
  `views` int(11) DEFAULT NULL COMMENT '浏览数',
