/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `realname` varchar(150) DEFAULT NULL COMMENT '真实姓名',
  `nickname` varchar(150) DEFAULT NULL COMMENT '昵称',
  `gender` tinyint(1) unsigned NOT NULL DEFAULT 3 COMMENT '性别:1男 2女 3保密',
  `avatar` varchar(150) DEFAULT NULL COMMENT '头像',
  `mobile` char(11) DEFAULT NULL COMMENT '手机号码',
  `email` varchar(30) DEFAULT NULL COMMENT '邮箱地址',
  `birthday` date DEFAULT NULL COMMENT '出生日期',
  `dept_id` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '部门ID',
  `level_id` smallint(3) unsigned NOT NULL DEFAULT 0 COMMENT '职级ID',
  `position_id` smallint(3) unsigned NOT NULL DEFAULT 0 COMMENT '岗位ID',
  `province_code` varchar(30) DEFAULT NULL COMMENT '省份ID',
  `city_code` varchar(30) DEFAULT NULL COMMENT '市区ID',
  `district_code` varchar(30) DEFAULT NULL COMMENT '区县ID',
  `address` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `city_name` varchar(150) DEFAULT NULL COMMENT '所属城市',
  `username` varchar(50) NOT NULL COMMENT '登录用户名',
  `password` varchar(150) DEFAULT NULL COMMENT '登录密码',
  `salt` varchar(30) DEFAULT NULL COMMENT '盐加密',
  `intro` varchar(500) DEFAULT NULL COMMENT '个人简介',
  `status` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '状态：1正常 2禁用',
  `note` varchar(500) DEFAULT NULL COMMENT '备注',
  `sort` smallint(5) unsigned NOT NULL DEFAULT 125 COMMENT '显示顺序',
  `login_num` smallint(6) unsigned NOT NULL DEFAULT 0 COMMENT '登录次数',
  `login_ip` varchar(20) DEFAULT NULL COMMENT '最近登录IP',
  `login_time` datetime DEFAULT NULL COMMENT '最近登录时间',
  `create_user` int(10) unsigned DEFAULT 0 COMMENT '添加人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` int(10) unsigned DEFAULT 0 COMMENT '更新人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `mark` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '有效标识(1正常 0删除)',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `realname` (`realname`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='后台用户管理表';

