/*Table structure for table `sys_user_role` */

DROP TABLE IF EXISTS `sys_user_role`;

CREATE TABLE `sys_user_role` (
  `user_id` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '人员ID',
  `role_id` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '角色ID',
  KEY `admin_id` (`user_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='人员角色表';

/*Data for the table `sys_user_role` */

insert  into `sys_user_role`(`user_id`,`role_id`) values (2,4),(3,4),(1,2),(1,3);

/*Table structure for table `ums_member` */

DROP TABLE IF EXISTS `ums_member`;

CREATE TABLE `ums_member` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `openid` varchar(50) DEFAULT NULL COMMENT '用户唯一标识',
  `mobile` char(11) NOT NULL COMMENT '手机号',
  `password` char(32) DEFAULT NULL COMMENT '密码',
  `member_level` smallint(3) NOT NULL DEFAULT 0 COMMENT '会员等级',
  `realname` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `nickname` varchar(50) DEFAULT NULL COMMENT '用户昵称',
  `gender` tinyint(1) unsigned NOT NULL DEFAULT 3 COMMENT '性别（1男 2女 3未知）',
  `avatar` varchar(180) DEFAULT '' COMMENT '用户头像',
  `birthday` date DEFAULT NULL COMMENT '出生日期',
  `province_code` varchar(30) DEFAULT NULL COMMENT '户籍省份编号',
  `city_code` varchar(30) DEFAULT NULL COMMENT '户籍城市编号',
  `district_code` varchar(30) DEFAULT NULL COMMENT '户籍区/县编号',
  `address` varchar(255) DEFAULT NULL COMMENT '详细地址',
  `intro` text DEFAULT NULL COMMENT '个人简介',
  `signature` varchar(30) DEFAULT NULL COMMENT '个性签名',
  `device` tinyint(1) unsigned NOT NULL DEFAULT 0 COMMENT '设备类型：1苹果 2安卓 3WAP站 4PC站 5后台添加',
  `device_code` varchar(40) DEFAULT NULL COMMENT '推送的别名',
  `login_status` tinyint(1) NOT NULL DEFAULT 2 COMMENT '用户状态(1登录 2登出)',
  `push_alias` varchar(40) DEFAULT '' COMMENT '推送的别名',
  `source` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '来源：1、APP注册；2、后台添加；',
  `status` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '是否启用 1、启用  2、停用',
  `app_version` varchar(30) DEFAULT '' COMMENT '客户端版本号',
  `code` varchar(10) DEFAULT NULL COMMENT '我的推广码',
  `login_ip` varchar(30) DEFAULT NULL COMMENT '最近登录IP',
  `login_time` datetime DEFAULT NULL COMMENT '登录时间',
  `login_region` varchar(20) DEFAULT NULL COMMENT '上次登录地点',
  `login_count` int(10) unsigned NOT NULL DEFAULT 0 COMMENT '登录总次数',
  `create_user` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '添加人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_user` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '修改人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `mark` tinyint(1) unsigned NOT NULL DEFAULT 1 COMMENT '有效标识：1正常 0删除',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `mobile` (`mobile`) USING BTREE,
  KEY `index_mobile` (`mobile`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6569 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='用户表';

